import { Form, Formik } from "formik";
import React, { useEffect, useState } from "react";
import FormikInput from "./Formik/FormikInput";
import axios from "axios";

const CreateHTLocation = () => {
    let [attributes, setAttributes] = useState([]);
  let getAttributes = async () => {
    try {
      let result = await axios({
        url: `http://localhost:8000/attributes`,
        method: `get`,
        headers: {
          Authorization: `Bearer ${localStorage.getItem("token")}`,
        },
      });
      setAttributes(result.data.result);
      console.log(result);
    } catch (error) {
        console.log(error)
    }
  };
  useEffect(() => {
    getAttributes();
  }, [])
  let initialValues = {
    hTName: "",
    location: "",
    length: {},
    elevationGain: {},
    description: "",
    startLatitude: "",
    startLongitude: "",
    endLatitude: "",
    endLongitude: "",
    attributes: [],
  };
  let onSubmit = () => {};
  return (
    <Formik
      initialValues={initialValues}
      // validationSchema={}
      onSubmit={onSubmit}
    >
      {(formik) => {
        return (
          <Form>
            <FormikInput
              id="hTName"
              label="Hike/Trek name"
              type="text"
              name="hTName"
              onChange={(e) => {
                formik.setFieldValue("hTName", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <br></br>
            <FormikInput
              id="location"
              label="Location"
              type="text"
              name="location"
              onChange={(e) => {
                formik.setFieldValue("location", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <br></br>
            <span>Starting Point</span>
            <FormikInput
              id="startLatitude"
              type="text"
              name="startLatitude"
              placeholder="Latitude"
              onChange={(e) => {
                formik.setFieldValue("startLatitude", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <FormikInput
              id="startLongitude"
              type="text"
              name="startLongitude"
              placeholder="Longitude"
              onChange={(e) => {
                formik.setFieldValue("startLongitude", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <span>Ending Point</span>
            <FormikInput
              id="endLatitude"
              type="text"
              name="endLatitude"
              placeholder="Latitude"
              onChange={(e) => {
                formik.setFieldValue("endLatitude", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <FormikInput
              id="endLongitude"
              type="text"
              name="endLongitude"
              placeholder="Longitude"
              onChange={(e) => {
                formik.setFieldValue("endLongitude", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <FormikInput
              id="hTName"
              label="Hike/Trek name"
              type="text"
              name="hTName"
              onChange={(e) => {
                formik.setFieldValue("hTName", e.target.value);
              }}
              required={true}
            ></FormikInput>
          </Form>
        );
      }}
    </Formik>
  );
};

export default CreateHTLocation;
